Syntax: RAW_TRACEPOINT_PROBE( event ) This is a macro that instruments the raw tracepoint defined by event . The argument is a pointer to struct bpf_raw_tracepoint_args, which is defined in bpf.h . The struct field args contains all parameters of the raw tracepoint where you can found at linux tree include/trace/events directory. For example: RAW_TRACEPOINT_PROBE(sched_switch)
{ // TP_PROTO(bool preempt, struct task_struct *prev, struct task_struct *next) struct task_struct *prev = (struct task_struct *)ctx->args[1]; struct task_struct *next= (struct task_struct *)ctx->args[2]; s32 prev_tgid, next_tgid; bpf_probe_read_kernel(&prev_tgid, sizeof(prev->tgid), &prev->tgid); bpf_probe_read_kernel(&next_tgid, sizeof(next->tgid), &next->tgid); bpf_trace_printk("%d -> %d\\n", prev_tgid, next_tgid);
} This instruments the sched:sched_switch tracepoint, and prints the prev and next tgid. Examples in situ: search /tools

