Syntax: BPF_RINGBUF_OUTPUT(name, page_cnt) Creates a BPF table for pushing out custom event data to user space via a ringbuf ring buffer. BPF_RINGBUF_OUTPUT has several advantages over BPF_PERF_OUTPUT, summarized as follows: Buffer is shared across all CPUs, meaning no per-CPU allocation Supports two APIs for BPF programs map.ringbuf_output() works like map.perf_submit() (covered in ringbuf_output ) map.ringbuf_reserve()/map.ringbuf_submit()/map.ringbuf_discard() split the process of reserving buffer space and submitting events into two steps (covered in ringbuf_reserve , ringbuf_submit , ringbuf_discard ) BPF APIs do not require access to a CPU ctx argument Superior performance and latency in userspace thanks to a shared ring buffer manager Supports two ways of consuming data in userspace Starting in Linux 5.8, this should be the preferred method for pushing per-event data to user space. Example of both APIs: struct data_t { u32 pid; u64 ts; char comm[TASK_COMM_LEN];
}; // Creates a ringbuf called events with 8 pages of space, shared across all CPUs
BPF_RINGBUF_OUTPUT(events, 8); int first_api_example(struct pt_regs *ctx) { struct data_t data = {}; data.pid = bpf_get_current_pid_tgid(); data.ts = bpf_ktime_get_ns(); bpf_get_current_comm(&data.comm, sizeof(data.comm)); events.ringbuf_output(&data, sizeof(data), 0 /* flags */); return 0;
} int second_api_example(struct pt_regs *ctx) { struct data_t *data = events.ringbuf_reserve(sizeof(struct data_t)); if (!data) { // Failed to reserve space return 1; } data->pid = bpf_get_current_pid_tgid(); data->ts = bpf_ktime_get_ns(); bpf_get_current_comm(&data->comm, sizeof(data->comm)); events.ringbuf_submit(data, 0 /* flags */); return 0;
} The output table is named events. Data is allocated via events.ringbuf_reserve() and pushed to it via events.ringbuf_submit(). Examples in situ: search /examples ,

