Syntax: void map.call(void *ctx, int index) This invokes bpf_tail_call() to tail-call the bpf program which the index entry in BPF_PROG_ARRAY points to. A tail-call is different from the normal call. It reuses the current stack frame after jumping to another bpf program and never goes back. If the index entry is empty, it won't jump anywhere and the program execution continues as normal. For example: BPF_PROG_ARRAY(prog_array, 10); int tail_call(void *ctx) { bpf_trace_printk("Tail-call\n"); return 0;
} int do_tail_call(void *ctx) { bpf_trace_printk("Original program\n"); prog_array.call(ctx, 2); return 0;
} b = BPF(src_file="example.c")
tail_fn = b.load_func("tail_call", BPF.KPROBE)
prog_array = b.get_table("prog_array")
prog_array[c_int(2)] = c_int(tail_fn.fd)
b.attach_kprobe(event="some_kprobe_event", fn_name="do_tail_call") This assigns tail_call() to prog_array[2]. In the end of do_tail_call(), prog_array.call(ctx, 2) tail-calls tail_call() and executes it. NOTE: To prevent infinite loop, the maximum number of tail-calls is 32 ( MAX_TAIL_CALL_CNT ). Examples in situ: search /examples , search /tests

