Syntax: BPF.attach_tracepoint(tp="tracepoint", fn_name="name") Instruments the kernel tracepoint described by tracepoint, and when hit, runs the BPF function name(). This is an explicit way to instrument tracepoints. The TRACEPOINT_PROBE syntax, covered in the earlier tracepoints section, is an alternate method with the advantage of auto-declaring an args struct containing the tracepoint arguments. With attach_tracepoint(), the tracepoint arguments need to be declared in the BPF program. For example: # define BPF program
bpf_text = """
#include <uapi/linux/ptrace.h> struct urandom_read_args { // from /sys/kernel/debug/tracing/events/random/urandom_read/format u64 __unused__; u32 got_bits; u32 pool_left; u32 input_left;
}; int printarg(struct urandom_read_args *args) { bpf_trace_printk("%d\\n", args->got_bits); return 0;
};
""" # load BPF program
b = BPF(text=bpf_text)
b.attach_tracepoint("random:urandom_read", "printarg") Notice how the first argument to printarg() is now our defined struct. Examples in situ: code , search /examples , search /tools

