Syntax: BPF.ring_buffer_poll(timeout=T) This polls from all open ringbuf ring buffers, calling the callback function that was provided when calling open_ring_buffer for each entry. The timeout parameter is optional and measured in milliseconds. In its absence, polling continues until there is no more data or the callback returns a negative value. Example: # loop with callback to print_event
b["events"].open_ring_buffer(print_event)
while 1: try: b.ring_buffer_poll(30) except KeyboardInterrupt: exit(); Examples in situ: search /examples ,

