Syntax: BPF.ring_buffer_consume() This consumes from all open ringbuf ring buffers, calling the callback function that was provided when calling open_ring_buffer for each entry. Unlike ring_buffer_poll, this method does not poll for data before attempting to consume. This reduces latency at the expense of higher CPU consumption. If you are unsure which to use, use ring_buffer_poll. Example: # loop with callback to print_event
