Syntax: table.open_perf_buffers(callback, page_cnt=N, lost_cb=None) This operates on a table as defined in BPF as BPF_PERF_OUTPUT(), and associates the callback Python function callback to be called when data is available in the perf ring buffer. This is part of the recommended mechanism for transferring per-event data from kernel to user space. The size of the perf ring buffer can be specified via the page_cnt parameter, which must be a power of two number of pages and defaults to 8. If the callback is not processing data fast enough, some submitted data may be lost. lost_cb will be called to log / monitor the lost count. If lost_cb is the default None value, it will just print a line of message to stderr. Example: # process event
def print_event(cpu, data, size): event = ct.cast(data, ct.POINTER(Data)).contents [...] # loop with callback to print_event
b["events"].open_perf_buffer(print_event)
while 1: try: b.perf_buffer_poll() except KeyboardInterrupt: exit() Note that the data structure transferred will need to be declared in C in the BPF program. For example: // define output data structure in C
struct data_t { u32 pid; u64 ts; char comm[TASK_COMM_LEN];
};
BPF_PERF_OUTPUT(events);
[...] In Python, you can either let bcc generate the data structure from C declaration automatically (recommended): def print_event(cpu, data, size): event = b["events"].event(data)
[...] or define it manually: # define output data structure in Python
TASK_COMM_LEN = 16 # linux/sched.h
class Data(ct.Structure): _fields_ = [("pid", ct.c_ulonglong), ("ts", ct.c_ulonglong), ("comm", ct.c_char * TASK_COMM_LEN)] def print_event(cpu, data, size): event = ct.cast(data, ct.POINTER(Data)).contents
