b["events"].open_ring_buffer(print_event)
while 1: try: b.ring_buffer_poll() except KeyboardInterrupt: exit() Note that the data structure transferred will need to be declared in C in the BPF program. For example: // define output data structure in C
struct data_t { u32 pid; u64 ts; char comm[TASK_COMM_LEN];
};
BPF_RINGBUF_OUTPUT(events, 8);
[...] In Python, you can either let bcc generate the data structure from C declaration automatically (recommended): def print_event(ctx, data, size): event = b["events"].event(data)
[...] or define it manually: # define output data structure in Python
TASK_COMM_LEN = 16 # linux/sched.h
class Data(ct.Structure): _fields_ = [("pid", ct.c_ulonglong), ("ts", ct.c_ulonglong), ("comm", ct.c_char * TASK_COMM_LEN)] def print_event(ctx, data, size): event = ct.cast(data, ct.POINTER(Data)).contents
[...] Examples in situ: search /examples ,

