The following tool records a histogram of disk I/O sizes. Sample output: # bitehist.py
Tracing... Hit Ctrl-C to end.
^C kbytes : count distribution 0 -> 1 : 3 | | 2 -> 3 : 0 | | 4 -> 7 : 211 |********** | 8 -> 15 : 0 | | 16 -> 31 : 0 | | 32 -> 63 : 0 | | 64 -> 127 : 1 | | 128 -> 255 : 800 |**************************************| Code is examples/tracing/bitehist.py : from __future__ import print_function
from bcc import BPF
from time import sleep # load BPF program
b = BPF(text="""
#include <uapi/linux/ptrace.h>
#include <linux/blkdev.h> BPF_HISTOGRAM(dist); int kprobe__blk_account_io_done(struct pt_regs *ctx, struct request *req)
{ dist.increment(bpf_log2l(req->__data_len / 1024)); return 0;
}
""") # header
print("Tracing... Hit Ctrl-C to end.") # trace until Ctrl-C
try: sleep(99999999)
except KeyboardInterrupt: print() # output
b["dist"].print_log2_hist("kbytes") A recap from earlier lessons: kprobe__: This prefix means the rest will be treated as a kernel function name that will be instrumented using kprobe. struct pt_regs *ctx, struct request *req: Arguments to kprobe. The ctx is registers and BPF context, the req is the first argument to the instrumented function: blk_account_io_done(). req->__data_len: Dereferencing that member. New things to learn: BPF_HISTOGRAM(dist): Defines a BPF map object that is a histogram, and names it "dist". dist.increment(): Increments the histogram bucket index provided as first argument by one by default. Optionally, custom increments can be passed as the second argument. bpf_log2l(): Returns the log-2 of the provided value. This becomes the index of our histogram, so that we're constructing a power-of-2 histogram. b["dist"].print_log2_hist("kbytes"): Prints the "dist" histogram as power-of-2, with a column header of "kbytes". The only data transferred from kernel to user space is the bucket counts, making this efficient.

